import sadEmoji from '../assets/images/sadEmoji.png';

export const STORAGEKEY = {
  ACCESSTOKEN: 'ACCESSTOKEN',
  AUTHENTICATED: 'AUTHENTICATED',
  ADMIN_EMAIL: 'ADMIN_EMAIL',
};

export const constants = {
  COLOR: '#4152a2',
  SAD_EMOJI: sadEmoji,
  ICON_COLOR: '#de7800',
  DIGIT_REGEX: /^[0-9]+$/,
  ALPHA_REGEX: /^[0-9\b]+$/,
  SPACE_REGEX: /^\S+$/,
};
